  false,\n\t\"url\": null,\n\t\"notes\": \"All marine mammals and sea turtles that
  were visually observed during a marine geophysical survey were recorded to: 1) determine
  whether a mitigation measure needed to be implemented during the survey; 2) determine
  the potential number of animals exposed to seismic sounds. During periods when no
  marine mammals were observed, the vessel location and the environmental conditions
  were also recorded approximately every 30 minutes whenever a Protected Species Observer
  was on watch (during daylight hours).\",\n\t\"license_title\": null,\n\t\"extras\":
